import React, { Component } from "react";
import Navbar from "./Components/Navbar";
import News from "./Components/News";
import {
  BrowserRouter as Router,
  Routes,
  Route
  ,
} from "react-router-dom";

class App extends Component {
  render() {
    return (
      <>
        <div>
          <Navbar />
          <Router>
            <Routes>
          <Route path="/" element={<News  pageSize={8} category="technology" country="in" />}></Route>
          <Route path="/business" element={<News  pageSize={8} category="business" country="in" />}></Route>
          <Route path="/entertainment" element={<News  pageSize={8} category="entertainment" country="in" />}></Route>
          <Route path="/general" element={<News  pageSize={8} category="general" country="in" />}></Route>
          <Route path="/health" element={<News  pageSize={8} category="health" country="in" />}></Route>
          <Route path="/science" element={<News  pageSize={8} category="science" country="in" />}></Route>
          <Route path="/sports" element={<News  pageSize={8} category="sports" country="in" />}></Route>
          <Route path="/technology" element={<News  pageSize={8} category="technology" country="in" />}></Route>
          </Routes>
          </Router>
        </div>

      </>
    );
  }
}

export default App;
